import React from "react";
import "./Card.css";
const Card = props => {
  return (
    <div className="col-sm-2">
      <div className="card">
        <img
          src={props.image}
          className="card-img-top"
          alt="shabuMenu"
          style={{ height: "197px", transition: "transform .2s" }}
        ></img>
        <div className="card-body">
          <p
            className="card-text"
            style={{
              fontSize: "1.5rem",
              textAlign: "center"
            }}
          >
            {props.text}
          </p>
        </div>
      </div>
    </div>
  );
};
export default Card;
